        "Weight": 20000,
        "EndureTemplateID": 4000,
        "Tutorial": "- Initially, <b>the molten horns located high up on its body contains <color style='color:#FF0000;'>16U Pyro</color></b>: The horn will increase its all RES by 60% (Abyss Version 80%), and it will unleash deadly attacks, creating Molten Areas that deal massive DoT.<br>- Molten horns are immune to Swirl's element application, and are only reachable when it unleashes certain attacks. Seize this opportunity and destroy it with reactions.<br>- After the horns are destroyed, it will lose all enhancements, but will regenerate its molten horns after 30s (Abyss Version 20s).<br>- Spiral Abyss Version will gain an extra 33% ATK boost, and will create even more Molten Areas.",
