        "Desc": "Sumpter Beasts are friends of humanity. These gentle-hearted creatures are indispensable elements of production and transportation.\nIn Sumeru, your wealth is symbolized by the number of Sumpter Beasts you own. Large merchant caravans and Eremites usually come with very sizable trains of Sumpter Beasts indeed, and this allows them to carry ample supplies and goods across both desert and forest alike.\nSumpter Beasts can adapt to various different natural environments. Long before the forest merchants ever noticed them, these hardworking animals were already the much-relied-upon domesticated beasts of the desert peoples.",
