    "90101": {
        "_id": 90101,
        "KingdomID": 9,
        "ClassID": 10901,
        "Name": "Stormterror Dvalin",
        "Title": [
            "Erstwhile King of the Skies"
        ],
        "Desc": "One of The Four Winds of Mondstadt: Dvalin, the Dragon of the East.\nWith the passage of long years and amid boundless darkness, even the purest gem will become dulled by dust, and even the noble dragon might be corrupted and cankered by hatred.\nBut never forget that dust can be wiped away, and the power of doubt and poison can be shattered.\n\n<i>\"Fly freely in the sky.</i>\n<i>\"Just like you did in those days when we met, when I walked upon this land and sang the songs of the wind,</i>\n<i>\"And you soared on high, looking down on the world from above.</i>\n<i>\"Today, the sky is no longer swept by wind and snow. The green grass grows all over the earth, and it is beautiful.</i>\n<i>\"If you too could walk the earth and listen to the songs of shepherds and the scattered sound of wind chimes in the distance, if you could have tasted wine as sweet as honey, you would understand.</i>\n<i>\"How wonderful it would have been if you were as I, witnessing your noble, beautiful form as you soared through the blue sky.</i>\n<i>\"Then you would know that this sky and this earth are both things worth fighting for.\"</i>",
        "Color": "Wind",
        "HP": 9.0,
        "HPCurve": 1,
        "ATK": 6.0,
        "ATKCurve": 4,
        "Icon": [
            "dv"
        ],
        "Grade": 4,
        "Weight": 20000,
        "EndureTemplateID": 4000,
        "Csx": [
            "ECEnemiesOfNote/特瓦林"
        ]
    },
