        "KingdomID": 9,
        "ClassID": 10909,
        "Name": "All-Devouring Narwhal",
        "Title": [
            "Visitor From the Far Side of the Sea of Stars"
        ],
        "Desc": "A mysterious and gargantuan creature from another world.\nPoets often liken the starry sky to the ocean. They've seen or dreamt of countless bioluminescent plankton floating on a moonless sea, resembling a galaxy, or the moonlight ripped apart by waves on the sea's surface, like shimmering stars. In the most fantastical stories or outrageous lies, the stars found in the depths of the cosmos might be teeming with life, much like Teyvat, and the universe itself is akin to an ocean. Realistically speaking, however, if a profound universe full of life exists, why hasn't any of that life made contact with Teyvat?\nMaybe the universe has been constantly trying to infiltrate Teyvat, or maybe a higher power created borders to protect this world.",
